pragma solidity ^0.8.26;
// SPDX-License-Identifier: GPL-1.0-or-later
import "solidity-json-writer/contracts/JsonWriter.sol";

contract Auction {
    using JsonWriter for JsonWriter.Json;

    address public owner;

    // you cannot add more than this amount of
    // products for bidding
    uint private maxProductsCount = 3;

    // no bid for no product can be lower 
    // than this amount. The amount is in gwei
    uint private minimumAllowedBid = 0;

    mapping (address => bool) public allowedBuyers;

    // unix timestamp of auction start time
    uint auctionStartTime;

    // unix timestamp of auction end time
    uint auctionEndTime;

    uint private minimumDurationOfAuction;

    struct Bid {
        address buyer;
        uint productCode; // name of the item being bid
        uint amount;
        bool put;
    }

    struct Product {
        uint code;
        uint startingPrice;
        bool exists;
    }

    // any call to addProduct() will add a new product
    // to this array. Only maxProductsCount amount is allowed
    mapping (uint => Product) products;

    // this is used to keep track of currently live products
    // + and - with each addition/removal
    uint liveProductsCount = 0;

    uint[] productsKeys;


    // currently put bids, a map of productCode => buyerAddress => Bid
    mapping (uint => mapping (address => Bid)) currentBids;
    // the winners for each item
    mapping (uint => Bid) winningBids;

    constructor(){
        owner = msg.sender;
        minimumDurationOfAuction = 30 * 60; // 30 minutes
    }

    function setAuctionTiming(uint start, uint end) external {
        require(msg.sender == owner, "only owner can set star/end time for the auction");
        require(start < end && end - start >= minimumDurationOfAuction, "auction duration cannot be shorter than 30 minutes");
        require(block.timestamp > start, "auction start time cannot be before current block");

        auctionStartTime = start;
        auctionEndTime = end;
    }

    // this function is used to authorize an entity to
    // be able to participate in the auction
    function authorize(address toBeBuyer) external {
        require(
            toBeBuyer == msg.sender, 
        "Only owner can auhtorize others for participation in the auction");

        require(
            allowedBuyers[toBeBuyer] == false,
            "Participant already added, skipped"
        );


        allowedBuyers[toBeBuyer] = true;
    }

    function unauthorize(address toBeBuyer) external {
        require(
            toBeBuyer == msg.sender, 
        "Only owner can unauhtorize others for participation in the auction");

        require(
            allowedBuyers[toBeBuyer] == true,
            "Participant does not exist"
        );
        delete allowedBuyers[toBeBuyer];
    }

    function bid(uint productCode, uint amount) external {
        require(block.timestamp > auctionStartTime, "auction has not yet started");
        require(block.timestamp < auctionEndTime, "acution is closed");


        require(allowedBuyers[msg.sender] == true,
        "You are not allowed to bid");
        require(products[productCode].exists == true, "item doesn't exist for bidding");
        require(amount >= minimumAllowedBid, "Bids cannot be lower than expected amount");

        if(currentBids[productCode][msg.sender].put){
            require(currentBids[productCode][msg.sender].amount < amount, "Bid amount cannot be lower than the previous amount");
            currentBids[productCode][msg.sender].amount = amount;
        } else {
            currentBids[productCode][msg.sender] = Bid({ 
            buyer: msg.sender,
            productCode: productCode,
            amount: amount,
            put: true}); 
        }

        if(winningBids[productCode].amount < amount) {
            winningBids[productCode] = Bid({ 
                buyer: msg.sender,
                productCode: productCode,
                amount: amount,
                put: true});
        }
    }

    // adds/removes a product to biddable products. It allows adding/removing product only before
    // an acution starts
    // isRemove if true, removes the product
    function product(uint productCode, uint startingBidPrice, bool isRemove) external {
        if(isRemove == false) {
            addProduct(productCode, startingBidPrice);
        } else {
            removeProduct(productCode);
        }
    }

    function addProduct(uint productCode, uint startingBidPrice) internal {
            require(block.timestamp < auctionStartTime, "Adding product is allowed before auction starts");
            require(msg.sender == owner, "Only owner can add a biddable product");
            require(productsKeys.length < maxProductsCount, "Too many products, remove some first.");

            if(products[productCode].exists == true){
                products[productCode].startingPrice = startingBidPrice;
            } else {
                products[productCode] = Product({code: productCode, startingPrice: startingBidPrice, exists: true});
                liveProductsCount++;
            }
    }

    function removeProduct(uint productCode) internal {
            require(block.timestamp < auctionStartTime, "removing product is only allowed before auction starts");
            require(products[productCode].exists == true, "product doesn't exist");

            for(uint i = 0; i < productsKeys.length; i++) {
                if(productsKeys[i] != productCode) {
                    uint lastElement = productsKeys[productsKeys.length-1];
                    productsKeys[productsKeys.length-1] = 0;
                    productsKeys[i] = lastElement;
                    productsKeys.pop();
                    break;
                }
            }
            delete products[productCode];
            liveProductsCount--;
    }

    // returns list of winners
    function getWinners() public view returns(string memory) {
        require(block.timestamp > auctionEndTime, "winners are announced after auction ends");
        JsonWriter.Json memory writer;
        writer = writer.writeStartArray();
        for(uint i = 0; i < productsKeys.length; i++) {
            if(winningBids[productsKeys[i]].put == true) {
                writer = writer.writeStartObject();
                writer = writer.writeUintProperty("Product Code", winningBids[productsKeys[i]].productCode);
                writer = writer.writeUintProperty("Amount", winningBids[productsKeys[i]].amount);
                writer = writer.writeAddressProperty("Buyer", winningBids[productsKeys[i]].buyer);
                writer = writer.writeEndObject();
            }            
        }
        writer = writer.writeEndArray();

        return writer.value;
    }
}

